  "terms_content": "<h2>Умови використання електронного інформаційного веб-сайту та додатку Асоціації PharmaLedger </h2><p>Відкриваючи або використовуючи веб-сайт і програму електронної інформації про продукти Асоціації PharmaLedger (\"Сервіси\"), ви погоджуєтеся дотримуватися цих положень та умов (\"Умови\"). Ви не можете отримати доступ або використовувати Послуги, якщо ви не згодні з цими Умовами. Послуги надаються Асоціацією PharmaLedger («Асоціація») і призначені для використання особами, які шукають інформацію про свої ліки. Багатостороння мережа надає Послуги, а ваш виробник ліків надає інформацію про продукт, що відображається за допомогою Послуг. Асоціація виступає контролером даних для цієї інформації.</p><h2>Використання Послуг </h2><p>Ви погоджуєтеся використовувати Послуги лише в законних цілях і таким чином, щоб не порушувати права, не обмежувати чи перешкоджати використанню та насолоді Послугами будь-якою третьою стороною. Таке обмеження або заборона включає, без обмеження, поведінку, яка є незаконною або яка може переслідувати будь-яку особу, спричинити страждання чи незручності, а також передачу непристойного чи образливого вмісту або порушення нормального перебігу діалогу в межах Послуг. </p><h2>Інтелектуальна власність </h2><p>Вміст Послуг, включаючи, але не обмежуючись, текст, графіка, зображення та програмне забезпечення, є власністю Асоціації або її ліцензіарів і компаній-членів і захищено авторським правом та іншими законами про інтелектуальну власність. Ви не маєте права використовувати будь-який вміст Послуг для будь-яких комерційних цілей без письмової згоди Асоціації. </p><h2>Відповідальність</h2><p>Асоціація не робить жодних заяв чи гарантій будь-якого роду, явних або неявних, щодо роботи Послуг або інформації, вмісту, матеріалів або продуктів, які входять до Послуг. Асоціація не несе відповідальності за будь-які збитки, спричинені використанням Послуг, включаючи, але не обмежуючись, прямими, непрямими, випадковими, штрафними та непрямими збитками. </p><h2>Регулююче право </h2><p>Ці Умови та використання вами Послуг регулюватимуться та тлумачитимуться відповідно до законодавства Швейцарії, а будь-які суперечки вирішуватимуться в судах Базеля, Швейцарія. </p><h2>Зміни до Умов </h2><p>Асоціація залишає за собою право змінювати ці Умови в будь-який час, і ви зобов’язані періодично перевіряти ці Умови на предмет будь-яких змін. Подальше користування Послугами після внесення будь-яких змін до Умов буде означати вашу згоду з переглянутими Умовами.</p><p><br></p>",
