  "about_content": "<h2>Про цей додаток</h2><p>Цей додаток надає вам компанія PharmaLedger®. Він був спільно розроблений організаціями, що представляють пацієнтів, фармацевтичними компаніями та експертами з технологій.</p><p>IВін дозволяє користувачам програми переглядати інформацію про свої ліки, скануючи штрих-код на упаковці продукту.</p><p>Відображену інформацію надає власник реєстраційного посвідчення продукту.</p><h2>Про PharmaLedger</h2><p>PharmaLedger® - торгова марка Асоціації   PharmaLedger (PLA).</p><p>Асоціація PharmaLedger - це глобальна неприбуткова нейтральна асоціація. Метою Асоціації є створення та популяризація екосистеми цифрової довіри в охороні здоров’я.</p><p>Асоціація сприяє співробітництву в галузі охорони здоров’я та медико-біологічних наук, а також сприяє інноваціям та їх впровадженню на взаємну вигоду пацієнтів та інших зацікавлених сторін.</p>",
