  "help_content": "<h2>Що таке EPI?</h2><p>    <b>EPI</b> — це абревіатура для <b>електронних відомостей про продукт</b>. Це електронна версія паперової брошури з інформацією про продукт, яку зазвичай можна знайти в упаковці фармацевтичного продукту. У деяких випадках    <b>EPI</b> може замінити паперову брошуру.</p><h2>Що таке PharmaLedger?</h2><p>Асоціація PharmaLedger (PLA) — це некомерційна асоціація, що базується в Швейцарії та має на меті створення та розвиток екосистеми цифрової довіри в охороні здоров’я за допомогою стандартизованої та надійної платформи з відкритим кодом. Асоціація PharmaLedger сприяє співпраці та прискорює інновації та впровадження для досягнення взаємної вигоди в сферах охорони здоров’я та медико-біологічних наук для пацієнтів та інших зацікавлених осіб. Асоціація PharmaLedger була створена в 2022 році для продовження роботи над проектом PharmaLedger, трирічним проектом, який фінансується Європейською комісією та фармацевтичною промисловістю і спрямований на доведення цінності рішень блокчейну Додаткова інформація доступна на сайті https://pharmaledger.org.</p><h2>Що таке DataMatrix?</h2><p>Це тип штрих-коду на упаковці продукту. Це чорно-білий квадратний штрих-код, який виглядатиме приблизно так:<br>    <img src=\"./images/barcode_example.png\" alt='DataMatrix barcode example'></p><h2>Як користуватися додатком?</h2><p>Дотримуйтесь інструкцій на цільовій сторінці <b>додатка...</b> на ній показано, де можна знайти<b> DataMatrix</b> на вашій упаковці продукту. Знайшовши <b>DataMatrix</b>, натисніть кнопку «Сканувати <b>DataMatrix</b>». Дозвольте програмі використовувати камеру, щоб можна було сканувати <b>DataMatrix</b> Використовуйте камеру, щоб сфокусуватися на <b>DataMatrix</b>. Після успішного сканування упаковки буде відображено <b>EPI</b>. Ви можете натиснути кнопку «+», щоб отримати докладнішу інформацію.</p><h2>Чому моє сканування DataMatrix не дає результату?</h2><p>Є кілька причин, чому <b>DataMatrix</b> на вашій може не давати EPI. Однією з причин міг бути фокус камери. Будь ласка, спробуйте відсканувати код у добре освітленому місці, щоб код був чітко видимим на екрані. Якщо вам важко тримати руку в рівному стані, ви можете спробувати використовувати стіл для опори рук.</p>",
